import React from 'react';
import { GoMail } from 'react-icons/go';
import { FaRegClock } from 'react-icons/fa';
import { useState } from 'react';
import Link from 'next/link';
import Router from 'next/router';
import NProgress from 'nprogress';
import { APP_NAME } from '../../config';
import { signout, isAuth } from '../../actions/auth';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from 'reactstrap';
import Search from './../blog/Search';

const Uheader = (props) => {
  return (
      <Navbar style={{ fontSize: '13px', height:'90px',lineHeight:'90px', backgroundColor:'#001f24'}} >
        <NavItem>
          <NavLink style={{color:'white'}} href="#">Notícias & Mídia</NavLink>
        </NavItem>
        <Nav style={{color:'white', marginLeft:'45%'}}>
        <NavItem>
          <NavLink style={{color:'white'}} disabled href="#"><GoMail /> &nbsp;contato@dental04.com</NavLink>
        </NavItem>
        <NavItem>
          <NavLink  style={{color:'white'}} disabled href="#"><FaRegClock style={{lineHeight:'15px'}}/> &nbsp;Seg-Sáb: 09h-18h</NavLink>
        </NavItem>
        <NavItem>
          <NavLink style={{color:'white'}} disabled href="#">PT-BR</NavLink>
        </NavItem>
        </Nav>

        {isAuth() && isAuth().role === 0 && (
              <NavItem>
                <Link href="/user">
                  <NavLink>{`${isAuth().name}'s Dashboard`}</NavLink>
                </Link>
              </NavItem>
            )}

            {isAuth() && isAuth().role === 1 && (
              <NavItem>
                <Link href="/admin">
                  <NavLink>{`${isAuth().name}'s Dashboard`}</NavLink>
                </Link>
              </NavItem>
            )}

            {isAuth() && (
              <NavItem>
                <NavLink style={{ cursor: 'pointer' }} onClick={() => signout(() => Router.replace(`/signin`))}>
                  Signout
                </NavLink>
              </NavItem>
            )}
            </Navbar>
          
      
       
     
  );
}

export default Uheader;
